    function showTooltip(x, y, contents, color) {
	$('<div id="tooltip">'+ contents + '</div>').css( {
            position: 'absolute',
            display: 'none',
            top: y + 5,
            left: x + 5,
            border: '1px solid #fdd',
            padding: '2px',
            'background-color': color,
            opacity: 0.6
        }).appendTo("body").fadeIn(200);
    }
	
 
    var previousPoint = null;
    $("#placeholder").bind("plothover", function (event, pos, item) {
        $("#x").text(pos.x.toFixed(2));
        $("#y").text(pos.y.toFixed(2));
		
       
		if (item) {
			if (previousPoint != item.dataIndex) {
				previousPoint = item.dataIndex;
				
				$("#tooltip").remove();
				$("#text").remove();
				var x = item.datapoint[0],
					y = item.datapoint[1];
					var time = new Date(x);
					var month = time.getMonth() + 1;
					var day = time.getDate();
					var hours = time.getUTCHours();
					var minutes = time.getMinutes() ;
					if (minutes < 10){
					minutes = "0" + minutes
					}
					var datetime = hours  + ':' + minutes + '  ' + month + '/' + day;
					if (item.series.label != "Block Found") {
						var content = "<center>" + item.series.label +" at <br>" + datetime + " =<br>" + y + "</center>";}
					else {
						var content = "<center>" + item.series.label +" at <br>" + datetime + "</center>"; }
					
					//set mouseover color
					if (item.series.label == "Hashrate (GH)") {
					var color = "#0099FF"
					}
					
					else if (item.series.label == "SMPPS Buffer") {
					var color = "#009900"
					}
					
					else if (item.series.label == "Workers") {
					var color = "#FF9900" 
					}
					
				showTooltip(item.pageX, item.pageY,
							content, color);
			}
		}
		else {
                $("#tooltip").remove();
                previousPoint = null;            
            }
            
        
    });

		if (item) {
			if (previousPoint != item.dataIndex) {
				previousPoint = item.dataIndex;
				
				$("#tooltip").remove();
				var x = item.datapoint[0],
					y = item.datapoint[1];
					var time = new Date(x);
					var month = time.getMonth() + 1;
					var day = time.getDate();
					var hours = time.getUTCHours();
					var minutes = time.getMinutes() ;
					if (minutes < 10){
					minutes = "0" + minutes
					}
					var datetime = hours  + ':' + minutes + '  ' + month + '/' + day;
					if (item.series.label != "Block Found") {
						var content = "<center>" + item.series.label +" at <br>" + datetime + " =<br>" + y + "</center>";}
					else {
						var content = "<center>" + item.series.label +" at <br>" + datetime + "</center>"; }
					
					if (item.series.label == "Hashrate (GH)") {
					var color = "#0099FF"
					}
					
					else if (item.series.label == "SMPPS Buffer") {
					var color = "#009900"
					}
				showTooltip(item.pageX, item.pageY,
							content, color);
			}
		}
		else {
                $("#tooltip").remove();
                previousPoint = null;            
            }
            
        
    });
});
</script> 
 
 
</body> 
</html>
